import { Panel, Divider } from "rsuite";

const Snippet = ({ header, description }) => {
  const snippetStyle = {
    marginLeft: "0.5rem",
    border: " 1px blue solid",
    borderRadius: 4,
    width: "95%",
    padding: "1rem",
  };
  <Panel header={header} style={snippetPanelStyle} collapsible>
    <Divider style={{ marginTop: 0 }} />
    <p>{description}</p>
  </Panel>;
};

export default Snippet;
